  Code = "class Solution:\n    def maximumStrongPairXor(self, nums: List[int]) -> int:\n        max_xor = 0\n        for i in range(len(nums)):\n            for j in range(i + 1, len(nums)):\n                num1, num2 = nums[i], nums[j]\n                if abs(num2 - num1) <= min(num1, num2):\n                    max_xor = max(max_xor, num1 ^ num2)\n        return max_xor "
